import React from 'react';
import './Rules.css';

const Rules = ({ onBack }) => {
  return (
    <div className="emu-container">
      <h1 className="gameTitle">Regolamento</h1>
      <div className="rulesContent">
        <p>Qui inserisci il regolamento del videogioco...</p>
      </div>
      <button className="homeButton" onClick={onBack}>Torna alla Home</button>
    </div>
  );
};

export default Rules;
